import React from "react";

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSoundcloud } from '@fortawesome/free-brands-svg-icons';
import { faYoutube } from '@fortawesome/free-brands-svg-icons';


function Podcast(){

    const soundCloudIcon = <FontAwesomeIcon icon={faSoundcloud} />
    const youTubeIcon = <FontAwesomeIcon icon={faYoutube} />

    return(
        <div className="podcastDiv">
            <h1>Screen Spew</h1>
            <img src={require("../imgs/screen-spew.jpg")} alt="cover for screen spew" />
            <p>How to listen!</p>
            <div className="iconDiv">
                <a href="https://soundcloud.com/screenspew">{soundCloudIcon}</a>
                <br />
                <a href="https://www.youtube.com/channel/UC8KWObQUN6X8UPI4UD2b3Gw">{youTubeIcon}</a>
            </div>
        </div>
    );
}

export default Podcast;
